import React, { Component } from 'react';
import '../sass/styles.css';
import gif from '../prenuvo_db/862625ef/1361ae6e/bw-gif.gif'


export default class App extends Component {


  onImgLoad = ({ target: img }) => {
    this.setState({
      width: img.width,
      height: img.height,
    });
  };

  render() {

    return (
      <div>
       <h1>IMAGES</h1> 
        <div>
          <img src={gif} alt="prenuvo" />
        </div>

      </div>
    )
  }
}
